import React from 'react';
import './App.css';

// Componente do ícone da flor SVG
const FlowerIcon = () => (
  <svg width="60" height="60" viewBox="0 0 60 60" fill="none" xmlns="http://www.w3.org/2000/svg">
    <g fill="white">
      <path d="M30 15C32.5 15 35 17.5 35 20C35 22.5 32.5 25 30 25C27.5 25 25 22.5 25 20C25 17.5 27.5 15 30 15Z"/>
      <path d="M45 30C45 27.5 42.5 25 40 25C37.5 25 35 27.5 35 30C35 32.5 37.5 35 40 35C42.5 35 45 32.5 45 30Z"/>
      <path d="M30 45C27.5 45 25 42.5 25 40C25 37.5 27.5 35 30 35C32.5 35 35 37.5 35 40C35 42.5 32.5 45 30 45Z"/>
      <path d="M15 30C15 32.5 17.5 35 20 35C22.5 35 25 32.5 25 30C25 27.5 22.5 25 20 25C17.5 25 15 27.5 15 30Z"/>
      <path d="M38.5 21.5C40.5 19.5 43.5 19.5 45.5 21.5C47.5 23.5 47.5 26.5 45.5 28.5C43.5 30.5 40.5 30.5 38.5 28.5C36.5 26.5 36.5 23.5 38.5 21.5Z"/>
      <path d="M38.5 38.5C36.5 36.5 36.5 33.5 38.5 31.5C40.5 29.5 43.5 29.5 45.5 31.5C47.5 33.5 47.5 36.5 45.5 38.5C43.5 40.5 40.5 40.5 38.5 38.5Z"/>
      <path d="M21.5 38.5C23.5 40.5 26.5 40.5 28.5 38.5C30.5 36.5 30.5 33.5 28.5 31.5C26.5 29.5 23.5 29.5 21.5 31.5C19.5 33.5 19.5 36.5 21.5 38.5Z"/>
      <path d="M21.5 21.5C19.5 23.5 19.5 26.5 21.5 28.5C23.5 30.5 26.5 30.5 28.5 28.5C30.5 26.5 30.5 23.5 28.5 21.5C26.5 19.5 23.5 19.5 21.5 21.5Z"/>
      <circle cx="30" cy="30" r="8" fill="#F7931E"/>
    </g>
  </svg>
);

// Componente das ondas
const WavesFooter = () => (
  <div className="waves-container">
    <svg className="waves" viewBox="0 0 400 120" preserveAspectRatio="none">
      <path className="wave-back" d="M0,60 C100,20 300,100 400,60 L400,120 L0,120 Z" fill="#F7931E" opacity="0.8"/>
      <path className="wave-middle" d="M0,80 C150,40 250,120 400,80 L400,120 L0,120 Z" fill="#F26722" opacity="0.9"/>
      <path className="wave-front" d="M0,100 C100,60 300,140 400,100 L400,120 L0,120 Z" fill="#FF5300"/>
    </svg>
  </div>
);

function App() {
  const handleWelcomeClick = () => {
    // Redireciona para tela de login
    alert('Redirecionando para Login...');
  };

  const handleCadastroClick = () => {
    // Redireciona para tela de cadastro
    alert('Redirecionando para Cadastro...');
  };

  return (
    <div className="app">
      <div className="container">
        <div className="main-card">
          {/* Logo e Título */}
          <div className="logo-section">
            <div className="logo-icon">
              <FlowerIcon />
            </div>
            <h1 className="app-title">Reciclo</h1>
          </div>

          {/* Botão Bem Vindo */}
          <button className="welcome-button" onClick={handleWelcomeClick}>
            Bem Vindo
          </button>

          {/* Seção LOGIN */}
          <div className="login-section">
            <div className="section-title">
              <span className="line"></span>
              <span className="text">LOGIN</span>
              <span className="line"></span>
            </div>
          </div>

          {/* Texto "ou" */}
          <div className="or-text">ou</div>

          {/* Seção CADASTRO */}
          <div className="cadastro-section">
            <div className="section-title">
              <span className="line"></span>
              <span className="cadastro-text" onClick={handleCadastroClick}>
                clique aqui para o <span className="cadastro-highlight">CADASTRO</span>
              </span>
              <span className="line"></span>
            </div>
          </div>

          {/* Ondas do rodapé */}
          <WavesFooter />
        </div>
      </div>
    </div>
  );
}

export default App;
